import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';


// should be only one ReactDOM.render (optional) method in your app
// React.StrictMode checks for possible issues with your codebase
// https://reactjs.org/docs/strict-mode.html
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
